import React from 'react';
import './PopularRestaurants.scss';

const PopularRestaurant:React.FC<{chef:string, image:string}> = (props) => {
  return (
    <div className="popular-item">
        <img src={props.image} alt="popular-img"></img>
        <h2>{props.name}</h2>
        <p>{props.chef}</p>
    </div>
  )
}

export default PopularRestaurant;
